import { Typography } from '@mui/material';
import React from 'react';
import CustomTimeline, { CustomTimelineSeparator } from '../Timeline/Timeline';
import PersonPinIcon from '@mui/icons-material/PersonPin';
import DownloadIcon from '@mui/icons-material/Download';
import resumeData from '../../utils/resumeData.js';
import './Profile.css';
import { TimelineConnector, TimelineContent, TimelineItem, TimelineSeparator } from '@mui/lab';
import CustomButton from '../Button/Button.js';

const CustomTimelineItem = ({ title, text, link }) => (
    <TimelineItem>
    <CustomTimelineSeparator />
    <TimelineContent className='timeline_content'>
    {link ? (<Typography className='timelineItem_text'><a href={link} target='_blank'>{text}</a></Typography>) : (
        <Typography className='timelineItem_text'><span>{title}:</span>{' '}{text}</Typography>
    )}
    </TimelineContent>
    </TimelineItem>
);


const Profile = () => {
    return (
        <div className='profile container_shadow'>
        <div className='profile_name'>
        <Typography className='name'>{resumeData.name}</Typography>
        <Typography className='title'>{resumeData.title}</Typography>
        </div>

        <figure className='profile_image'>
        <img src={require('../../assets/images/displayImage.jpg')} alt=""/>
        </figure>
        <div className='profile_information'>
        <CustomTimeline classname='person_icon' icon={<PersonPinIcon />}>
        <CustomTimelineItem title='Name' text={resumeData.name} />
        <CustomTimelineItem title='Email' text={resumeData.email} />

        {Object.keys(resumeData.socials).map((key) => (
            <CustomTimelineItem title={key} text={resumeData.socials[key].text} link={resumeData.socials[key].link} />
        ))}

        </CustomTimeline>
        <br/>
        <CustomButton text={'Download my CV'}/>
        </div>
        </div>
    );
};

export default Profile;
